import React, { useState, useEffect } from "react";
import { Bar } from "react-chartjs-2";

function BarChart(props) {
  const [tyypit, setTyypit] = useState(props.tyypit);
  const [tyyppimaarat, setTyyppiaarat] = useState({
    laavut: 0,
    kodat: 0,
    paivatuvat: 0,
    nuotiopaikat: 0,
    luolat: 0,
    auotiotuvat: 0,
    ruokailukatokset: 0,
    nahtavyydet: 0,
    lintutornit: 0,
    varaustuvat: 0,
    kammit: 0,
    porokampat: 0,
    lahteet: 0,
  });

  useEffect(() => {
    setTyypit(props.tyypit);
  }, [props.tyypit]);

  console.log("barchart tyypit:", tyypit);
  return (
    <div className="barchart-wrapper">
      <Bar
        data={{
          labels: [...tyypit],
          datasets: [
            {
              label: "test",
              data: [1, 2, 3, 4],
              backgroundColor: "blue",
            },
          ],
        }}
      ></Bar>
    </div>
  );
}

export default BarChart;
